import Search from './Search'

const Header = () => {
  return ( 
    <header id="header">
      <div id="logo">
        <div class="pull-left">
          <a href="https://aerobasegroup.com">
            <img src="https://aerobasegroup.com/public/images/xlogo.png.pagespeed.ic.bzagu1WTAC.webp" id="logoimg" style={{maxHeight: "110px", width: "auto"}} alt="AeroBase Group, Inc."/>
          </a>
        </div>
        <div id="main_nav">
          <div class="pull-right margin-bottom">
            <i class="fa fa-phone"></i>&nbsp;&nbsp;321-802-5889&nbsp;&nbsp;&nbsp;
            <i class="fa fa-fax"></i>&nbsp;&nbsp;321-733-7477
          </div>
          <Search />
        </div>
      </div>
		</header>	
   );
}
 
export default Header;
